// src/components/Navbar.jsx
const Navbar = () => {
    const navItems = [
      "home", "about", "education", "skills",
      "projects", "certifications", "resume", "contact",
    ];

    return (
      <nav className="bg-blue-600 shadow-lg">
        <ul className="flex justify-center space-x-6 py-4">
          {navItems.map((item) => (
            <li key={item}>
              <a href={`#${item}`} className="text-white hover:text-gray-300 capitalize">
                {item.replace(/-/g, " ")}
              </a>
            </li>
          ))}
        </ul>
      </nav>
    );
  };

  export default Navbar;
